PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "username" varchar(255), "password" varchar(255), "email" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "recipes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar(255), "body" text, "user_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "ingredients_names" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "locales" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "language" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "ingredient_names" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "locale_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "expression" varchar(255));
CREATE TABLE "display_names" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "locale_id" integer, "text" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "ingredients" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name_EN" varchar(255), "source" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "tag_id" integer, "tag" integer);
CREATE TABLE "tags" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "display_name_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_recipes_on_user_id" ON "recipes" ("user_id");
CREATE INDEX "index_ingredient_names_on_locale_id" ON "ingredient_names" ("locale_id");
CREATE INDEX "index_display_names_on_locale_id" ON "display_names" ("locale_id");
CREATE INDEX "index_tags_on_display_name_id" ON "tags" ("display_name_id");
CREATE INDEX "index_ingredients_on_tag" ON "ingredients" ("tag");
COMMIT;
